import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'vyne';
}

import {Component, Input, OnInit} from '@angular/core';
import {IconName, icons} from '../icons/icons';

@Component({
  selector: 'app-button',
  template: `
    <button
      [ngClass]="{'disabled' : !enabled, 'primary': type === 'primary', 'default': type === 'default', 'tertiary' : type === 'tertiary', 'small' : size === 'small' }">
      <img *ngIf="icon" [attr.src]="iconMap[icon!]">
      <ng-content></ng-content>
    </button>`,
  styleUrls: ['./button.component.scss']
})
export class ButtonComponent {
  @Input()
  icon: IconName | null = null;

  // To get around binding issues
  iconMap = icons;

  @Input()
  enabled = true;

  @Input()
  size: 'small' | 'default' = 'default';

  @Input()
  type: 'primary' | 'default' | 'tertiary' = 'default';
}

styleUrlsData.data:
@import "src/styles/theme";
button {
  display: flex;
  align-items: center;
  border: none;
  border-radius: $border-radius;
  padding: 0.5rem 0.7rem;
  font-weight: 400;
  font-family: $headings-font;
  font-size: 0.87rem;
  line-height: 1.3;

  background-color: $base-1;
  &:hover:not(.disabled) {
    background-color: $base-3;
    cursor: pointer;
  }
  img {
    width: 1rem;
    height: 1rem;
    margin-right: 0.5rem;
  }
}


button.small {
  font-size: 0.75rem;
  border-radius: $border-radius-small;
  img {
    width: 0.75rem;
    height: 0.75rem;
  }
}

.default:not(.disabled) {
  color: $primary;
  img {
    // Make it blue:
    // Colors from here: https://codepen.io/sosuke/pen/Pjoqqp
    filter:  invert(49%) sepia(35%) saturate(6774%) hue-rotate(195deg) brightness(79%) contrast(86%);
    opacity: 0.8;
  }
}

.disabled {
  background-color: $base-2;
  color: rgba($body-color, 0.5);
  opacity: 0.7;
  &:hover {
    background-color: $base-2;
  }
}

.primary:not(.disabled) {
  @extend .celtic;
  img {
    // Make it white:
    // Get the values by using this tool:
    // https://codepen.io/sosuke/pen/Pjoqqp
    filter: invert(100%) sepia(100%) saturate(2%) hue-rotate(190deg) brightness(105%) contrast(101%);;
    opacity: 0.8;
  }
  &:hover {
    background-color: $primary-light;
  }
}

